INSERT INTO crags (id, name, latitude, longitude, type, tide_level, created_at, description, country, region) VALUES ('a3e2e611-ee9b-4934-907a-987e2c84c536', 'Fort Le Marchant', 49.508282, -2.518023, 'boulder', NULL, '2026-01-04T09:02:10.544+00:00', 'A great crag for intermediate to advanced climbers. With local classic highballs, shorter testpieces, and open projects, all without being overly tidal. The only issue is being shot at: If you see a red flag, the crag is a no go; If you hear the crack of a bullet: Duck! 
INSERT INTO crags (id, name, latitude, longitude, type, tide_level, created_at, description, country, region) VALUES ('1ad3877a-3752-4d31-a284-256b4092b811', 'La Catalain', 49.505154, -2.520319, 'boulder', NULL, '2026-01-04T09:02:10.956+00:00', 'Predominantly serving the beginner to intermediates, this mostly non-tidal crag has a trivial approach, highballs for the brave, and a few tough lines and projects, while being a short distance from Pembroke East and Fort Le Marchant. With a trivial approach to most of the climbing, the only thing not to like is being shot at. When you see a red flag, the crag is a no go! 
INSERT INTO crags (id, name, latitude, longitude, type, tide_level, created_at, description, country, region) VALUES ('7ada03aa-ce1b-4e46-84dd-ce30c561a831', 'Pembroke East', 49.503056, -2.522389, 'boulder', NULL, '2026-01-04T09:02:11.16+00:00', 'This crag sprawls from the grassy slopes down onto the rocks, featuring a wide array of rock and problem styles, mostly below the V3 mark. 
INSERT INTO crags (id, name, latitude, longitude, type, tide_level, created_at, description, country, region) VALUES ('6dc7b133-6bf4-4858-9b49-d5ab5fef5d10', 'Pembroke West', 49.507175, -2.532118, 'boulder', NULL, '2026-01-04T09:02:11.355+00:00', 'The most striking feature of this crag is the slab wall, which has a number of great problems for those not afraid of the fall! Besides this, dotted around you''ll find a number of isolated boulders and walls, especially toward low tide, good potential for first ascents. 
INSERT INTO crags (id, name, latitude, longitude, type, tide_level, created_at, description, country, region) VALUES ('3fe6acfb-b689-4a75-9810-628794f57763', 'Fort Doyle', 49.505498, -2.505978, 'boulder', NULL, '2026-01-04T09:02:11.541+00:00', 'One of the classic crags of the island, hosting many hard problems, but also extensive climbing below V5. Here and there lines remain to be done, mostly in the V5+ range. 
INSERT INTO crags (id, name, latitude, longitude, type, tide_level, created_at, description, country, region) VALUES ('c4f6a12c-73f9-4828-853d-ce3f2a007c56', 'Beaucette', 49.501377, -2.504545, 'boulder', NULL, '2026-01-04T09:02:11.737+00:00', 'Beaucette is spread over the mouth of the marina, the north featuring a density of climbs below V3, and the south featuring harder problems, albeit underdeveloped. The 985 wall at the southern mouth is ripe for first ascents, just watch out for the slippery landing. Going from one side of the mouth to the other is suprisingly challenging, so factor a relatively long walk in if you wish to visit both. 
INSERT INTO crags (id, name, latitude, longitude, type, tide_level, created_at, description, country, region) VALUES ('e5dc8b20-025f-4217-8ac2-d3d32c6a214b', 'Bouldering Circuit', 49.507721, -2.536879, 'boulder', NULL, '2026-01-04T09:02:11.936+00:00', 'Here you''ll find a particularly nice set of non-tidal problems, alongside some quality, often scary tall, problems lower down. The crag caters most to the lower grades, but offers some great potential for hard first ascents. 
INSERT INTO crags (id, name, latitude, longitude, type, tide_level, created_at, description, country, region) VALUES ('8108e575-edb8-444f-86da-44812250b38e', 'Belle Elizabeth', 49.425383, -2.651886, 'boulder', NULL, '2026-01-04T09:02:12.156+00:00', 'As with many southern crags, Belle Elizabeth is adventurous to get to, but massively underdeveloped. Problems spanning the grades can be found here, with some very high quality rock available too. Care should always be taken with the approach, and an awareness of the tide should always be with you. 
INSERT INTO crags (id, name, latitude, longitude, type, tide_level, created_at, description, country, region) VALUES ('5f764cf2-db3d-4185-b645-7e9238631624', 'Point De La Moye East', 49.418702, -2.591637, 'boulder', NULL, '2026-01-04T09:02:12.351+00:00', 'For the south this crags boasts an easy approach, and quality rock. A number of problems have been done, and although the crag is relatively small, there is great potential for first ascents, especially at the harder grades. 
INSERT INTO crags (id, name, latitude, longitude, type, tide_level, created_at, description, country, region) VALUES ('0da9aa76-d957-4b08-b64c-546a68593922', 'Point De La Moye South', 49.417306, -2.591833, 'boulder', NULL, '2026-01-04T09:02:12.568+00:00', 'This crag has an epic approach, and has suprisingly few problems either for first ascent or already climbed, but a few problems are worth the scramble. 
INSERT INTO crags (id, name, latitude, longitude, type, tide_level, created_at, description, country, region) VALUES ('1b3834ff-9818-4721-84b1-330819d1796a', 'Port Soif', 49.48894, -2.579758, 'boulder', NULL, '2026-01-04T09:02:12.777+00:00', 'Port soif features a number of problems in the mid-grades, the rock generally being on the aggressive side. Being home to the island''s first V6 its is worth a visit, with a little potential for first ascents. 
INSERT INTO crags (id, name, latitude, longitude, type, tide_level, created_at, description, country, region) VALUES ('a7f26a19-5ef6-455d-9e9f-316482781d38', 'Crag at 50.3404, -3.6947', 50.3403602, -3.6947354, 'crag', NULL, '2026-01-08T21:28:46.719894+00:00', NULL, NULL, NULL);
